// Función para detener sonidos en reproducción
function detenerSonidos() {
  for (let key in sonidos) {
    if (!sonidos[key].paused) {
      sonidos[key].pause();
      sonidos[key].currentTime = 0; // Reiniciar el sonido
    }
  }
}

